Information
------------------------------

India Natures Wonderland
India is a land where the natural world has been woven into people's lives, a place where you can see animals that exist nowhere else on earth and where wilderness still holds strong. Wildlife expert Liz Bonnin, actor Freida Pinto and mountaineer Jon Gupta reveal the wonders of India's natural world.


1)  Part 1 
This edition starts with Liz visiting the Gir Forest, home to the world's last Asiatic lions, where she witness two females hunting, before watching elephants walking through a tea plantation. Freida meets a man who has dedicated his life to the Hoolock gibbon, India's only ape, which starts the morning by singing. Jon climbs into the Himalayas and stops off at Debprayag to bathe in the sacred waters at a holy place where the River Ganges begins.

2)  Part 2 
Part two of two. Wildlife expert Liz Bonnin, Slumdog Millionaire actress Freida Pinto and mountaineer Jon Gupta explore the natural world in India, including a village of birds, masks that come alive, an impressive mountain range and also profile baby turtles erupting out of the sand.

